import React from 'react';
import Medias from '../Medias/index.tsx';
import Logo from '../../shared/Logo/Logo.tsx';
import styles from './styles/header.module.scss';
import '../../Scss/styles.scss';

const Header = () => {
    return (
        <header className={styles.header}>
            <Logo />
            <nav className='flex'>
                <ul className={`${styles.navigationList} flex justify-between`}>
                    <li className='Oswald400 gray uppercase pointer'>Каталог</li>
                    <li className='Oswald400 gray uppercase pointer'>Каталог</li>
                    <li className='Oswald400 gray uppercase pointer'>Каталог</li>
                    <li className='Oswald400 gray uppercase pointer'>Каталог</li>
                    <li className='Oswald400 gray uppercase pointer'>Каталог</li>
                    <li className='Oswald400 gray uppercase pointer'>Каталог</li>
                </ul>
            </nav>
            <div className={styles.contactBlock}>
                <a className='Oswald400 green' href="#!">zakaz@loverflower.by</a>
                <h2 className='mb-5 Oswald300 gray'>Доставка 24/7 по договоренности с оператором</h2>
                <h2 className='Oswald400 green'>ул. Тимирязева 67</h2>
                <h2 className='mb-16 Oswald300 gray'>10:00 до 21:00 без выходных</h2>
                <Medias />
                <a className='mb-5 Oswald400 green' href="#!">+375 (29) 113-69-69</a>
            </div>
        </header>
    );
};

export default Header;
